#include "hqcoeff.h"
#include "constants.h"
#include "chaplin.h"

#include <cmath>

///
///
/// O(alphas)

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (7)
double chLg_1_0(double eta, double chi)	{
	double result(0.0);
	double sqrteta		= std::sqrt(eta);
	double sqrt1peta	= std::sqrt(1.+eta);
	result	+= M_PI/2.0 * QCD::TR * chi / std::pow(1+eta+chi/4,3) * (
		2*sqrt1peta*sqrteta
		- std::log((sqrt1peta+sqrteta)/(sqrt1peta-sqrteta))
	);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (8)
double chTg_1_0(double eta, double chi) {
	double result(0.0);
	double sqrteta		= std::sqrt(eta);
	double sqrt1peta	= std::sqrt(1.+eta);
	result	+= M_PI/2.0 * QCD::TR / std::pow(1+eta+chi/4,3) * (
		- 2.0* ( std::pow(1+eta-chi/4,2)+1+eta)*sqrteta/sqrt1peta
		+ (
			2.0 * std::pow(1+eta,2) + std::pow(chi,2)/8.0 + 1 + 2*eta
		)*(
			std::log((sqrt1peta+sqrteta)/(sqrt1peta-sqrteta))
		)
	);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] paragraph after eq. (6), page 4
double ch2g_1_0(double eta, double chi) {
	return chLg_1_0(eta, chi) + chTg_1_0(eta,chi);
}

///
///
/// O(alphas^2)


/// ================================
/// ====== GLUON CONTRIBUTION ======
/// ================================

///
/// O(ln(muR2/m2)^0)

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (24)
double I_hqhelper(double chi)	{
	double result(0.);
	double	sqrtchi		=	std::sqrt(chi),
			sqrt4pchi	=	std::sqrt(4.+chi);
	result				+=	4./(sqrtchi*sqrt4pchi) * (
		- M_PI*M_PI/6. - 0.5*std::pow(std::log(
			(sqrt4pchi+sqrtchi)/(sqrt4pchi-sqrtchi)
		),2)
		+ std::pow(std::log(
			(sqrt4pchi-sqrtchi)/(2*sqrt4pchi)
		),2) + 2 * HPL2(0, 1, (sqrt4pchi-sqrtchi)/(2*sqrt4pchi)) /// HPL2(0,1,x) = HPL({0,1},x) = Li2(x)
	);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (23)
double J_hqhelper(double chi)	{
	double result(0.);
	double	sqrtchi		=	std::sqrt(chi),
			sqrt4pchi	=	std::sqrt(4.+chi);
	result				+=	4./(sqrtchi*sqrt4pchi) * std::log(
		(sqrt4pchi+sqrtchi)/(sqrt4pchi-sqrtchi)
	);
	return result;
}


/// Longitudinal part
/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (9) rearranged
double chL_g_2_0(double eta, double chi)	{
	double	result(0.0);
	double 	beta	=	std::sqrt(eta/(1.+eta)),
			rho		=	1./(1.+eta);
	result			+=	QCD::TR * QCD::CA * (
						beta*chL_g_2_0_asympG(eta, chi)
						+ rho*chL_g_2_0_A_asympE(eta, chi)
						+ chL_g_2_0_A_interp(eta,chi)
					);
	result			+=	QCD::TR * QCD::CF * (
						rho*chL_g_2_0_F_asympE(eta, chi)
						+ chL_g_2_0_F_interp(eta,chi)
					);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (19)
double chL_g_2_0_asympG(double eta, double chi)	{
	double result(0.);
	result	+=	1./(6.*M_PI) * (
				4./chi - 4./3. * 1./(1.+chi/4.)
				+ (1. - 2./chi - 1./6. * 1./(1+chi/4.)) * J_hqhelper(chi)
				- (3./chi + 1./4. * 1./(1.+chi/4.)) * I_hqhelper(chi)
			);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (15)
double chL_g_2_0_A_asympE(double eta, double chi)	{
	double	result(0.);
	double 	beta	=	std::sqrt(eta/(1.+eta));
	result			+=	1./(6.*M_PI) * chi / std::pow(1.+chi/4.,3) * beta * beta * (
		beta * std::pow(std::log(8.*beta*beta),2)
		- 5 * beta * std::log(8.*beta*beta)
		- M_PI * M_PI / 4.
	);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (13)
double chL_g_2_0_F_asympE(double eta, double chi)	{
	double	result(0.);
	double 	beta	=	std::sqrt(eta/(1.+eta));
	result			+=	1./(6.*M_PI) * chi / std::pow(1.+chi/4.,3) * beta * beta * M_PI * M_PI / 2.;
	return result;
}

double chL_g_2_0_A_interp(double eta, double chi)	{
	if(not chL_g_2_0_A_interper_initialized)	{
		std::vector<double> x, y, z;
		for(int i_eta = 0; i_eta < 73; i_eta++)	{
			for(int i_chi = 0; i_chi < 49; i_chi++)	{
				x.push_back(ch_g_2_logetalist[i_eta]);
				y.push_back(ch_g_2_logchilist[i_chi]);
				z.push_back(chL_g_2_0_A_table[i_chi][i_eta]);
			}
		}
		chL_g_2_0_A_interper.setData(x,y,z);
		chL_g_2_0_A_interper_initialized = true;
	}

	return chL_g_2_0_A_interper(std::log10(eta), std::log10(chi));
}

double chL_g_2_0_F_interp(double eta, double chi)	{
	if(not chL_g_2_0_F_interper_initialized)	{
		std::vector<double> x, y, z;
		for(int i_eta = 0; i_eta < 73; i_eta++)	{
			for(int i_chi = 0; i_chi < 49; i_chi++)	{
				x.push_back(ch_g_2_logetalist[i_eta]);
				y.push_back(ch_g_2_logchilist[i_chi]);
				z.push_back(chL_g_2_0_F_table[i_chi][i_eta]);
			}
		}
		chL_g_2_0_F_interper.setData(x,y,z);
		chL_g_2_0_F_interper_initialized = true;
	}

	return chL_g_2_0_F_interper(std::log10(eta), std::log10(chi));
}

