/// Transversal part

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (9)
double chT_g_2_0(double eta, double chi)	{
	double	result(0.0);
	double 	beta	=	std::sqrt(eta/(1.+eta)),
			rho		=	1./(1.+eta);
	result			+= QCD::TR * QCD::CA *(
		beta * chT_g_2_0_asympG(eta, chi)
		+ rho * chT_g_2_0_A_asympE(eta, chi)
		+ chT_g_2_0_A_interp(eta, chi)
	);
	result			+= QCD::TR * QCD::CF *(
		rho * chT_g_2_0_F_asympE(eta, chi)
		+ chT_g_2_0_F_interp(eta, chi)
	);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (20)
double chT_g_2_0_asympG(double eta, double chi)	{
	double result(0.0);
	result += 1/(6.*M_PI) * (
		- 2./3. * 1./chi + 4./3. * 1./(1.+chi/4.)
		+ (7./6. + 1./3. * 1./chi + 1./6. * 1./(1.+chi/4.)) * J_hqhelper(chi)
		+ (1. + 2./chi + 1./4. * 1./(1.+chi/4.)) * I_hqhelper(chi)
	);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (16)
double chT_g_2_0_A_asympE(double eta, double chi)	{
	double result(0.0);
	double 	beta	=	std::sqrt(eta/(1.+eta));
	result 			+= 1/(4.*M_PI) * 1./(1.+chi/4.) * (
		beta * std::pow(std::log(8*beta*beta),2)
		- 5 * beta * std::log(8*beta*beta)
		- M_PI * M_PI / 4.
	);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (14)
double chT_g_2_0_F_asympE(double eta, double chi)	{
	double result(0.0);
	result += 1./(4.*M_PI) * 1./(1.+chi/4.) * M_PI * M_PI / 2.;
	return result;
}

