bool	chT_g_2_0_A_interper_initialized = false,
		chT_g_2_0_F_interper_initialized = false;

_2D::BicubicInterpolator<double> 	chT_g_2_0_A_interper,
									chT_g_2_0_F_interper;

/// 2 part
double ch2_g_2_0(double eta, double chi)	{
	return chL_g_2_0(eta,chi) + chT_g_2_0(eta,chi);
}


///
/// O(ln(muR2/m2)^2)

/// Longitudinal part

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (12)
double chL_g_2_1(double eta, double chi)	{
	double	result(0.0);
	double 	beta	=	std::sqrt(eta/(1.+eta)),
			rho		=	1./(1.+eta);
	result			+=	QCD::TR * QCD::CA * (
						beta*chL_g_2_1_asympG(eta, chi)
						+ rho*chL_g_2_1_A_asympE(eta, chi)
						+ chL_g_2_1_interp(eta,chi)
					);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (21)
double chL_g_2_1_asympG(double eta, double chi)	{
	double result(0.);
	result	+=	1./(6.*M_PI) * (
				- 6./chi + 0.5 * 1./(1.+chi/4.)
				+ (3./chi + 0.25 * 1./(1.+chi/4.)) * J_hqhelper(chi)
			);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (17)
double chL_g_2_1_A_asympE(double eta, double chi)	{
	double 	result(0.0);
	double 	beta	=	std::sqrt(eta/(1.+eta));
	result			+=	1./(6.*M_PI) * chi / std::pow(1.+chi/4.,3) * std::pow(beta,3) * (-1.*std::log(4*beta*beta));
	return 	result;
}

double chL_g_2_1_interp(double eta, double chi)	{
	if(not chL_g_2_1_interper_initialized)	{
		std::vector<double> x, y, z;
		for(int i_eta = 0; i_eta < 73; i_eta++)	{
			for(int i_chi = 0; i_chi < 49; i_chi++)	{
				x.push_back(ch_g_2_logetalist[i_eta]);
				y.push_back(ch_g_2_logchilist[i_chi]);
				z.push_back(chL_g_2_1_table[i_chi][i_eta]);
			}
		}
		chL_g_2_1_interper.setData(x,y,z);
		chL_g_2_1_interper_initialized = true;
	}

	return chL_g_2_1_interper(std::log10(eta), std::log10(chi));
}

