bool chL_g_2_1_interper_initialized = false;
_2D::BicubicInterpolator<double> 	chL_g_2_1_interper;


/// Transversal part

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (12)
double chT_g_2_1(double eta, double chi)	{
	double result(0.0);
	double 	beta	=	std::sqrt(eta/(1.+eta)),
			rho		=	1./(1.+eta);
	result			+= QCD::CA * QCD::TR * (
		beta * chT_g_2_1_asympG(eta, chi)
		+ rho * chT_g_2_1_A_asympE(eta, chi)
		+ chT_g_2_1_interp(eta, chi)
	);
	return result;
}

/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (22)
double chT_g_2_1_asympG(double eta, double chi)	{
	double result(0.0);
	result += 1./(6.*M_PI) * (
		4./chi - 1./2. * 1./(1.+chi/4.)
		- (1. + 2./chi + 1./4. * 1./(1.+chi/4.)) * J_hqhelper(chi)
	);
	return result;
}

double chT_g_2_1_A_asympE(double eta, double chi)	{
	double result(0.0);
	double 	beta	=	std::sqrt(eta/(1.+eta));
	result			+=	1./(4.*M_PI) * 1./(1.+chi/4.) * beta * (-1. * std::log(4*beta*beta));
	return result;
}

double chT_g_2_1_interp(double eta, double chi)	{
	if(not chT_g_2_1_interper_initialized)	{
		std::vector<double> x, y, z;
		for(int i_eta = 0; i_eta < 73; i_eta++)	{
			for(int i_chi = 0; i_chi < 49; i_chi++)	{
				x.push_back(ch_g_2_logetalist[i_eta]);
				y.push_back(ch_g_2_logchilist[i_chi]);
				z.push_back(chT_g_2_1_table[i_chi][i_eta]);
			}
		}
		chT_g_2_1_interper.setData(x,y,z);
		chT_g_2_1_interper_initialized = true;
	}

	return chT_g_2_1_interper(std::log10(eta), std::log10(chi));
}

