bool chT_g_2_1_interper_initialized = false;
_2D::BicubicInterpolator<double> chT_g_2_1_interper;

/// 2 part
double ch2_g_2_1(double eta, double chi)	{
	return chL_g_2_1(eta, chi) + chT_g_2_1(eta, chi);
}






























/// ================================
/// ====== QUARK CONTRIBUTION ======
/// ================================

///
/// O(ln(muR2/m2)^0)

/// Hcoupl -- photon couples to heavy quark

/// Longitudinal part
/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (26)
double chL_q_2_0_Hcoupl(double eta, double chi)	{
	double result(0.0);
	double 	beta	=	std::sqrt(eta/(1.+eta));
	result			+=	QCD::CF * QCD::TR *	(
		std::pow(beta,3) * chL_g_2_0_asympG(eta, chi)
		+ chL_q_2_0_Hcoupl_interp(eta,chi)
	);
	return result;
};

double chL_q_2_0_Hcoupl_interp(double eta, double chi)	{
	if(not chL_q_2_0_Hcoupl_interper_initialized)	{
		std::vector<double> x, y, z;
		for(int i_eta = 0; i_eta < 73; i_eta++)	{
			for(int i_chi = 0; i_chi < 49; i_chi++)	{
				x.push_back(ch_g_2_logetalist[i_eta]);
				y.push_back(ch_g_2_logchilist[i_chi]);
				z.push_back(chL_q_2_0_Hcoupl_table[i_chi][i_eta]);
			}
		}
		chL_q_2_0_Hcoupl_interper.setData(x,y,z);
		chL_q_2_0_Hcoupl_interper_initialized = true;
	}

	return chL_q_2_0_Hcoupl_interper(std::log10(eta), std::log10(chi));
}

