bool chT_q_2_0_Hcoupl_interper_initialized = false;
_2D::BicubicInterpolator<double> chT_q_2_0_Hcoupl_interper;

/// 2 part
double ch2_q_2_0_Hcoupl(double eta, double chi)	{
	return chT_q_2_0_Hcoupl(eta, chi) + chL_q_2_0_Hcoupl(eta, chi);
}

/// Lcoupl -- photon couples to light quark

/// Longitudinal part
/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (28)
double chL_q_2_0_Lcoupl(double eta, double chi)	{
	double result(0.0);
	result			+=	QCD::CF * QCD::TR *	(
		chL_q_2_0_Lcoupl_interp(eta,chi)
	);
	return result;
};

double chL_q_2_0_Lcoupl_interp(double eta, double chi)	{
	if(not chL_q_2_0_Lcoupl_interper_initialized)	{
		std::vector<double> x, y, z;
		for(int i_eta = 0; i_eta < 73; i_eta++)	{
			for(int i_chi = 0; i_chi < 49; i_chi++)	{
				x.push_back(ch_g_2_logetalist[i_eta]);
				y.push_back(ch_g_2_logchilist[i_chi]);
				z.push_back(chL_q_2_0_Lcoupl_table[i_chi][i_eta]);
			}
		}
		chL_q_2_0_Lcoupl_interper.setData(x,y,z);
		chL_q_2_0_Lcoupl_interper_initialized = true;
	}

	return chL_q_2_0_Lcoupl_interper(std::log10(eta), std::log10(chi));
}

