bool chL_q_2_1_Lcoupl_interper_initialized	= false;
_2D::BicubicInterpolator<double> chL_q_2_1_Lcoupl_interper;


/// Transversal part
/// @brief from [Riemersma, Smith, van Neerven; Phys. Let. B, 347 (1-2), 143, 1995] eq. (29)
double chT_q_2_1_Lcoupl(double eta, double chi)	{
	double result(0.0);
	result			+=	QCD::CF * QCD::TR *	(
		chT_q_2_1_Lcoupl_interp(eta,chi)
	);	
	return result;
};

double chT_q_2_1_Lcoupl_interp(double eta, double chi)	{
	if(not chT_q_2_1_Lcoupl_interper_initialized)	{
		std::vector<double> x, y, z;
		for(int i_eta = 0; i_eta < 73; i_eta++)	{
			for(int i_chi = 0; i_chi < 49; i_chi++)	{
				x.push_back(ch_g_2_logetalist[i_eta]);
				y.push_back(ch_g_2_logchilist[i_chi]);
				z.push_back(chT_q_2_1_Lcoupl_table[i_chi][i_eta]);
			}
		}
		chT_q_2_1_Lcoupl_interper.setData(x,y,z);
		chT_q_2_1_Lcoupl_interper_initialized = true;
	}

	return chT_q_2_1_Lcoupl_interper(std::log10(eta), std::log10(chi));
};

